import CoffeeListStyle from '../Style/CoffeeList.module.css'
import { Link } from 'react-router-dom'
import Pic1 from '../Pic/CoffeeListPic/CinnamonAndCocoa.png'
import Pic2 from '../Pic/CoffeeListPic/Coco&VanillaCream.png'
import Pic3 from '../Pic/CoffeeListPic/BurstingBlueberry.png'
import Pic4 from '../Pic/CoffeeListPic/DalgonaMacha.png'
import Pic5 from '../Pic/CoffeeListPic/DrizzledWithCaramel.png'
import Pic6 from '../Pic/CoffeeListPic/WhippedChocolate.png'
import { useSelector, useDispatch } from 'react-redux'
import { useEffect } from 'react'
import { getCoffeeList } from '../store/modules/foodsStore'

const CoffeeList = () => {
    const dispatch = useDispatch()
    const { coffeeList } = useSelector(state => state.foods)

    useEffect(() => {
        dispatch(getCoffeeList())
    }, [dispatch])
    
    const CoffeeMap = [
        { url: Pic1, price: '99.00', name: 'Cinnamon And Cocoa' },
        { url: Pic2, price: '199.00', name: 'Coco & Vanilla Cream' },
        { url: Pic3, price: '120.00', name: 'Bursting Blueberry' },
        { url: Pic4, price: '150.00', name: 'Dalgona Macha' },
        { url: Pic5, price: '199.00', name: 'Drizzled With Caramel' },
        { url: Pic6, price: '99.00', name: 'Whipped Chocolate' },
    ]

    return (
        <div className={CoffeeListStyle.CoffeeListMain}>

            {CoffeeMap.map(item => {
                return (
                    <div className={CoffeeListStyle.CoffeeItem} key={item.url}>
                        <div className={CoffeeListStyle.CoffeeItemImg} style={{ backgroundImage: `url(${item.url})` }} >
                            <Link to={"/SelectedCoffee?name=" + item.name + "&price=" + item.price}><button></button></Link>
                        </div>
                        <div className={CoffeeListStyle.CoffeeItemPrice}>{item.price}</div>
                        <div className={CoffeeListStyle.CoffeeItemName}>{item.name}</div>
                    </div>
                )
            })}

        </div>
    )
}

export default CoffeeList
